  `identifier` varchar(80) DEFAULT NULL COMMENT '统计归属标识',
  `seq` int(11) NOT NULL DEFAULT '0' COMMENT '记录排序号',
  `record_name` varchar(50) NOT NULL COMMENT '记录名称',
  `record_value` varchar(50) NOT NULL COMMENT '记录值',
