  `tmp_field_id` bigint(20) DEFAULT NULL COMMENT '临时标记数据域ID',
  PRIMARY KEY (`id`),
  UNIQUE KEY `field` (`field`,`record_name`,`record_tuple`,`record_cluster`,`timeline`,`identifier`)
) ENGINE=InnoDB AUTO_INCREMENT=229259 DEFAULT CHARSET=utf8;

